INSERT INTO reviews (author_name, profile_photo_url, rating, relative_time_description, text, time) VALUES
  (E'Victor Morozov', E'https://lh3.googleusercontent.com/a/ACg8ocIIfPIt5m1Myrz8_sIr032h2rIBAV_w4j7WK7B1Lu0zjZODXw=w36-h36-p-rp-mo-br100', 5, E'5 months ago', E'I rarely ever write reviews, but this one truly deserves it. Taylors Collision in Duluth is a top-notch shop! My Model S recently suffered significant hood damage, and Max at Taylors did an outstanding job repairing it. The paint match is flawless‚Äîthere isn‚Äôt even a hint that any damage was ever there.\n\nI‚Äôm very detail-oriented, and finding a shop I can fully trust has always felt nearly impossible. I‚Äôve heard plenty of horror stories, but after this experience, Taylors Collision is now my go-to for high-end, quality work.\n\nI also have to mention Max‚Äîhe‚Äôs a man of integrity, honesty, and professionalism. It‚Äôs rare to come across someone so trustworthy in this industry. I couldn‚Äôt recommend him and the shop more highly.', 1727049600),
  (E'Aaron Bell', E'https://lh3.googleusercontent.com/a/ACg8ocKjyGwNbEBRJp5Q5v2NT3j0ZMvUH_eRSJ0e0iOUKkGhcL82-w=w36-h36-p-rp-mo-br100', 5, E'6 months ago', E'I was recommended to use Taylor''s Collision by my family mechanic - Merriam Automotive, and I can see why!\n\nTaylor''s Collision was phenomenal to work with, and they did top notch, front-end work on my 2010 Honda Accord Coupe! My 15 year old Accord looks virtually brand new now with the new bumper and headlights.\n\nThe paint work is professional - no orange peel here. What impressed me the most, however, is that they were more than happy to buff out a couple scratches that they had accidentally put on the car during repairs. I pointed them out to Max when I came to pick up the car, and he immediately directed his team to come over and buff the blemishes right there on the spot.\n\nMax was very professional and friendly, and his team did beautiful work on my car. Shop local, and give these guys a try!', 1724457600),
  (E'Mac Herron', E'https://lh3.googleusercontent.com/a/ACg8ocJnpuUE0IFbwD5vDOujnWM4GKfDXe92alIFi64Mm9R8KDlCjg=w36-h36-p-rp-mo-br100', 5, E'7 months ago', E'I‚Äôve been coming to Taylor‚Äôs Collision for years and can‚Äôt recommend them enough. Max is great to work with. Compared to other body shops he truly takes pride in his work and looks out for the customer. He goes the extra mile to make sure everything looks great and finds ways to keep costs down when possible. It‚Äôs rare to find that level of care and honesty. 5 stars', 1721865600),
  (E'Melanie Richards', E'https://lh3.googleusercontent.com/a-/ALV-UjVs_c0gXKuuLmg_dLvrpy88q7so3Mjyb3nXp-kS7xn0StPCSZ8q=w36-h36-p-rp-mo-ba2-br100', 5, E'a month ago', E'I took my vehicle to Taylor‚Äôs Collision for damage caused by an another vehicle. When I visited for the first time to obtain an estimate, Paul, was super friendly and professional. The repair was performed quickly and there is no evidence that the vehicle was damaged. All of the staff that I interacted with during my visits were very nice and helpful.\n\nHopefully I don‚Äôt have to return for any servicesüòâ, but in the event that my car gets damaged in the future, I will certainly take my car to Taylor‚Äôs collision.', 1737417600),
  (E'Cinna Attar', E'https://lh3.googleusercontent.com/a/ACg8ocKVklV5_26QJmbIJDhEf5VPVwOkVGENIp7gmxlsgMLQciQwcA=w36-h36-p-rp-mo-br100', 5, E'a month ago', E'We took our Honda CR-V to Taylor‚Äôs Collision following a minor fender bender. Max promptly assessed the damage and provided a quote within minutes, which was more competitive than the three other estimates we received.\n\nWe left the vehicle with an expected completion time of four days. Although the shop was clearly busy, the team remained highly responsive throughout the process and made the experience significantly less stressful. The repairs were completed on schedule, and the car looked like new when we picked it up.\n\nMy wife and I highly recommend Taylor‚Äôs Collision for their professionalism, communication, and quality of work.', 1737417600),
  (E'Taylor Collins', E'https://lh3.googleusercontent.com/a-/ALV-UjXAHg9P3GmFWyMYaG7w42wmplcCRss-3ul8wm1B_FRZ4DQ0sDE=w36-h36-p-rp-mo-ba2-br100', 5, E'a year ago', E'The pictures speak for themselves. As a car guy, I''m very particular about who touches my vehicles. Taylor''s Collision came highly recommended by my family mechanic, Peter Merriam, and I couldn''t be happier with the results. They handled everything perfectly - from replacing and painting the fender to installing new headlights and grille. The color matching is flawless. Simply stunning work.', 1708473600),
  (E'Alex Sem', E'https://lh3.googleusercontent.com/a/ACg8ocL0oI_NbpUvxbPoE3SGIsY0N6FFEE6_rsDZxHZYSvqdDYkgI-Eo=w36-h36-p-rp-mo-br100', 5, E'7 months ago', E'I‚Äôve known Max, Daniel, and Andrey for many years, and I can confidently say they are some of the most genuine and trustworthy people I‚Äôve ever met. If I had to describe them in a few words, it would be men of character, honesty, and transparency.\n\nA few years ago, we purchased a bus for our ministry. When Max saw it, he immediately volunteered to help us prepare it before taking it to Nicaragua. Out of pure generosity, they repainted the hood, repaired the AC, and completed several other repairs‚Äînot for profit, but simply because they care. That act alone spoke volumes about their hearts, and I could share many more stories like it.\n\nIn a world where genuine kindness is rare, their goodness has brought me to tears on more than one occasion. Taylor‚Äôs Collision isn‚Äôt just about quality work‚Äîit‚Äôs about people who serve with integrity and heart. I couldn‚Äôt recommend them more highly.', 1721865600),
  (E'Tae Chang', E'https://lh3.googleusercontent.com/a/ACg8ocIA_7kYI74d__n370SUlB2EdhIQLx3PzMeBf1Q9KIav7nZg0A=w36-h36-p-rp-mo-br100', 5, E'5 months ago', E'Took a couple of my cars here after an accident, they do a phenomenal job and can‚Äôt even notice there was a giant dent before it got there. Max is my point of contact whenever I go and he takes very good care of me in the manner he speaks and the detailed information of what I have to expect and a equally detailed information of what has been done. Highly recommend anyone who needs their car to look good as new.', 1727049600),
  (E'Michael McMahon', E'https://lh3.googleusercontent.com/a/ACg8ocJD8TLmwmhYaefgGlZxw0xZ5PBh8yz7pcGJok44bRACefCqzg=w36-h36-p-rp-mo-ba3-br100', 5, E'a month ago', E'Daughter''s 2022 Corolla had significant front end body damage. They did a great job and worked it all out with the insurance company. It did take a little longer than expected but it was over the Thanksgiving Day to New Years holidays so there was 4-5 days they were closed. I''d use them again.', 1737417600),
  (E'Justin Koavlyuk', E'https://lh3.googleusercontent.com/a-/ALV-UjX9SINqN4trvAv5FlIyhABSZKasBc2uXjgrX5alFVtQtdZbTjEa=w36-h36-p-rp-mo-br100', 5, E'7 months ago', E'I couldn‚Äôt be happier with my experience at Taylor‚Äôs Collision! From the moment I walked in, the staff was professional, honest, and incredibly helpful. They walked me through the entire repair process, answered all my questions, and kept me updated every step of the way.\n\nThe quality of the work was exceptional ‚Äî my car looks brand new again! You‚Äôd never know there had been any damage. They paid great attention to detail, matched the paint perfectly, and returned the vehicle spotless inside and out.\n\nTurnaround time was faster than expected, and the price was very fair for the level of quality and service. It‚Äôs rare to find a shop that combines skill, transparency, and great customer care like this.\n\nIf you‚Äôre looking for an auto body shop you can actually trust, this is it. I‚Äôll definitely be coming back (hopefully not too soon, though!) and recommending them to everyone I know', 1721865600),
  (E'Maddox Gutierrez', E'https://lh3.googleusercontent.com/a/ACg8ocKJt68YXHOUZ9ZKSyrh8BtpTVY0H8Irp8hKb6rLEKHVoTUtIQ=w36-h36-p-rp-mo-br100', 5, E'5 months ago', E'Thank you to Taylor collision. Max and his team did amazing work on my e92 m3. They painted my new trunk and repainted the bumper and fix the imperfections. The car looks brand new and I am super happy with the results', 1727049600),
  (E'Arthur Rad', E'https://lh3.googleusercontent.com/a-/ALV-UjWlOj2jwLjoUwTD-qzJpyMZNVFGe3vp5IJnhhlwuNVB4qJYxdIA=w36-h36-p-rp-mo-br100', 5, E'7 months ago', E'Have taken a few cars here, always very happy with the finished work. Took my 4Runner in most recently to install a new bumper. Good quality job!', 1721865600),
  (E'Joshua Fair', E'https://lh3.googleusercontent.com/a/ACg8ocKOiORUTBncPoANrp_xt1ZDc0ZW8kL0FGq0aIuKWtZiMJGjCoY=w36-h36-p-rp-mo-ba4-br100', 5, E'2 years ago', E'I recently had the unfortunate experience of dealing with body damage on my brand new GMC AT4HD due to a hit and run incident. Thankfully, I found Taylor''s Collision to help rectify the situation, and I must say Max and Dennis did an excellent job.\n\nWhat sets Taylor''s Collision apart is not only their expertise in auto body repair but also their commitment to being a family and locally owned business. From the moment I walked through their doors, I felt like more than just another customer; I felt like a valued member of the community.\n\nThe repair work they performed on my Sierra was nothing short of impressive. The attention to detail and craftsmanship they put into their work was evident from the moment I laid eyes on my vehicle again. Not only did they restore it to its pre-accident condition, but they went above and beyond to ensure that every dent and scratch was meticulously addressed.\n\nMoreover, Max, Dennis, and the staff at Taylor''s Collision were incredibly friendly and accommodating throughout the entire process. They kept me informed about the progress of the repairs and were always ready to answer any questions I had. This level of customer service is truly commendable and made the whole experience much more pleasant.\n\nIn addition to the high-quality work and excellent customer service, the fact that Taylor''s Collision is a family and locally owned business is a significant selling point. It''s heartening to support a business that is deeply rooted in the community, and you can feel their passion for what they do in every interaction.\n\nOverall, I couldn''t be more satisfied with the service I received at Taylor''s Collision. They not only fixed my vehicle but also provided a personalized and friendly experience that you might not find at larger, corporate-owned repair shops. I wholeheartedly recommend Taylor''s Collision to anyone in need of automotive repair services. They are a shining example of a local business that truly cares about its customers and their community.', 1676937600),
  (E'Larisa Rudnev', E'https://lh3.googleusercontent.com/a/ACg8ocIc48GvHbTfgYq9yt8cDFyLNDF6w-Y8_m1R0p7dh5xx-UJbmg=w36-h36-p-rp-mo-br100', 5, E'7 months ago', E'Finding a good and honest collision repair shop these days feels nearly impossible but Taylor‚Äôs Collision truly exceeded my expectations. From the very beginning, I could tell the owner values integrity and transparency, which gave me peace of mind throughout the entire process. There were no surprise charges, no unnecessary upsells just honest advice, fair pricing, and top-quality work.\n\nThe paint and color matching were flawless, my car looks even better than before the damage. They finished the work quicker than I expected, and the price was more than fair for the level of care and craftsmanship I received.\n\nCustomer service was excellent. Max and his team made sure I was happy with the results. I‚Äôm beyond satisfied and genuinely grateful to have found a collision shop that puts honesty and customer satisfaction first. I am recommending Taylor‚Äôs Collision to my family, friends, and neighbors!', 1721865600),
