  (E'Mark Lisiuk', E'https://lh3.googleusercontent.com/a/ACg8ocIswrZS0cvhdceqzSnjkeAOMcev1BebjtYeqD5O1_U9R8NrBQ=w36-h36-p-rp-mo-br100', 5, E'6 months ago', E'Happy to say I found a great auto shop. Staff were very knowledgeable. The service here was better than great. They got started on my cars estimate pretty much as soon as I got in the door. Clear communication throughout the repair, they kept me updated. The repair was perfect, I couldn‚Äôt tell that anything happened to my car. Highly recommended!!!!!', 1724457600),
